(ns adventofcode2018.day05
  (:require [clojure.string :as s]))

(defn str-to-int [str]
  (if (= str nil)
    0
    (int str)))

(defn reacts? [str1 str2]
  (= 32 (Math/abs (- (str-to-int str1)
                     (str-to-int str2)))))

(defn reduction [input]
  (reduce #(if (reacts? (peek %1) %2)
             (pop %1)
             (conj %1 %2))
          [] input)
  )

(defn polymer [input]                                       ;; part 1
  (count (reduction input)))

(defn shrink [input small-letter]
  (-> (s/replace input small-letter "")
      (s/replace (s/upper-case small-letter) "")))

(def alphabet-list (s/split "abcdefghijklmnopqrstuvwxyz" #"(?=[a-z])"))

(defn shortest-polymer [input]                              ;; part 2
  (reduce min (map #(polymer (shrink input %)) alphabet-list)))

(def input "")